We’re going to deploy the NFT contract to the Goerli testnet, but to do this we’ll need to configure Foundry a bit, by setting things like a Goerli RPC URL, the private key of an account that’s funded with Goerli Eth, and an Etherscan key for the verification of the NFT contract. 💡 Note: You can get some Goerli testnet ETH here . Environment Configuration Once you have all that create a .env file and add the variables. Foundry automatically loads in a .env file present in your project directory. The .env file should follow this format: GOERLI_RPC_URL=
PRIVATE_KEY=
ETHERSCAN_API_KEY= We now need to edit the foundry.toml file. There should already be one in the root of the project. Add the following lines to the end of the file: [rpc_endpoints]
goerli = "${GOERLI_RPC_URL}" [etherscan]
goerli = { key = "${ETHERSCAN_API_KEY}" } This creates a RPC alias for Goerli and loads the Etherscan API key. Writing the Script Next, we have to create a folder and name it script and create a file in it called NFT.s.sol. This is where we will create the deployment script itself. The contents of NFT.s.sol should look like this: // SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13; import "forge-std/Script.sol";
import "../src/NFT.sol"; contract MyScript is Script { function run() external { uint256 deployerPrivateKey = vm.envUint("PRIVATE_KEY"); vm.startBroadcast(deployerPrivateKey); NFT nft = new NFT("NFT_tutorial", "TUT", "baseUri"); vm.stopBroadcast(); }
} Now let’s read through the code and figure out what it actually means and does. // SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13; Remember even if it’s a script it still works like a smart contract, but is never deployed, so just like any other smart contract written in Solidity the pragma version has to be specified. import "forge-std/Script.sol";
import "../src/NFT.sol"; Just like we may import Forge Std to get testing utilities when writing tests, Forge Std also provides some scripting utilities that we import here. The next line just imports the NFT contract. contract MyScript is Script { We create a contract called MyScript and it inherits Script from Forge Std. function run() external { By default, scripts are executed by calling the function named run, our entrypoint. uint256 deployerPrivateKey = vm.envUint("PRIVATE_KEY"); This loads in the private key from our .env file. Note: you must be careful when exposing private keys in a .env file and loading them into programs. This is only recommended for use with non-priviliged deployers or for local / test setups. For production setups please review the various wallet options that Foundry supports. vm.startBroadcast(deployerPrivateKey); This is a special cheatcode that records calls and contract creations made by our main script contract. We pass the deployerPrivateKey in order to instruct it to use that key for signing the transactions. Later, we will broadcast these transactions to deploy our NFT contract. NFT nft = new NFT("NFT_tutorial", "TUT", "baseUri"); Here we just create our NFT contract. Because we called vm.startBroadcast() before this line, the contract creation will be recorded by Forge, and as mentioned previously, we can broadcast the transaction to deploy the contract on-chain. The broadcast transaction logs will be stored in the broadcast directory by default. You can change the logs location by setting broadcast in your foundry.toml file. Now that you’re up to speed about what the script smart contract does, let’s run it. You should have added the variables we mentioned earlier to the .env for this next part to work. At the root of the project run: # To load the variables in the .env file
source .env # To deploy and verify our contract
forge script script/NFT.s.sol:MyScript --rpc-url $GOERLI_RPC_URL --broadcast --verify -vvvv Forge is going to run our script and broadcast the transactions for us - this can take a little while, since Forge will also wait for the transaction receipts. You should see something like this after a minute or so: contract verified This confirms that you have successfully deployed the NFT contract to the Goerli testnet and have also verified it on Etherscan, all with one command.

