You can add your own assertions by creating your own base test contract and having that inherit from the test framework of your choice. For example, if you use DSTest, you could create a base test contract like this: contract TestBase is DSTest { function myCustomAssertion(uint a, uint b) { if (a != b) { emit log_string("a and b did not match"); fail(); } }
} You would then inherit from TestBase in your test contracts. contract MyContractTest is TestBase { function testSomething() { // ... }
} Similarly, if you use Forge Std , you can create a base test contract that inherits from Test. For a good example of a base test contract that has helper methods and custom assertions, see Solmate's DSTestPlus .

