Internal Functions To test internal functions, write a harness contract that inherits from the contract under test (CuT). Harness contracts that inherit from the CuT expose the internal functions as external ones. Each internal function that is tested should be exposed via an external one with a name that follows the pattern exposed_<function_name>. For example: // file: src/MyContract.sol
contract MyContract { function myInternalMethod() internal returns (uint) { return 42; }
} // file: test/MyContract.t.sol
import {MyContract} from "src/MyContract.sol"; contract MyContractHarness is MyContract { // Deploy this contract then cll this method to test `myInternalMethod`. function exposed_myInternalMethod() external returns (uint) { return myInternalMethod(); }
} Private Functions Unfortunately there is currently no good way to unit test private methods since they cannot be accessed by any other contracts. Options include: Converting private functions to internal. Copy/pasting the logic into your test contract and writing a script that runs in CI check to ensure both functions are identical. Workaround Functions Harnesses can also be used to expose functionality or information otherwise unavailable in the original smart contract. The most straightforward example is when we want to test the length of a public array. The functions should follow the pattern: workaround_<function_name>, such as workaround_queueLength(). Another use case for this is tracking data that you would not track in production to help test invariants. For example, you might store a list of all token holders to simplify validation of the invariant "sum of all balances must equal total supply". These are often known as "ghost variables". You can learn more about this in Rikard Hjort 's Formal Methods for the Working DeFi Dev talk.

