Let's extend our NFT by adding metadata to represent the content of our NFTs, as well as set a minting price, a maximum supply and the possibility to withdraw the collected proceeds from minting. To follow along you can replace your current NFT contract with the code snippet below: // SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.10; import "solmate/tokens/ERC721.sol";
import "openzeppelin-contracts/contracts/utils/Strings.sol";
import "openzeppelin-contracts/contracts/access/Ownable.sol"; error MintPriceNotPaid();
error MaxSupply();
error NonExistentTokenURI();
error WithdrawTransfer(); contract NFT is ERC721, Ownable { using Strings for uint256; string public baseURI; uint256 public currentTokenId; uint256 public constant TOTAL_SUPPLY = 10_000; uint256 public constant MINT_PRICE = 0.08 ether; constructor( string memory _name, string memory _symbol, string memory _baseURI ) ERC721(_name, _symbol) { baseURI = _baseURI; } function mintTo(address recipient) public payable returns (uint256) { if (msg.value != MINT_PRICE) { revert MintPriceNotPaid(); } uint256 newTokenId = ++currentTokenId; if (newTokenId > TOTAL_SUPPLY) { revert MaxSupply(); } _safeMint(recipient, newTokenId); return newTokenId; } function tokenURI(uint256 tokenId) public view virtual override returns (string memory) { if (ownerOf(tokenId) == address(0)) { revert NonExistentTokenURI(); } return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, tokenId.toString())) : ""; } function withdrawPayments(address payable payee) external onlyOwner { uint256 balance = address(this).balance; (bool transferTx, ) = payee.call{value: balance}(""); if (!transferTx) { revert WithdrawTransfer(); } }
} Among other things, we have added metadata that can be queried from any front-end application like OpenSea, by calling the tokenURI method on our NFT contract. Note : If you want to provide a real URL to the constructor at deployment, and host the metadata of this NFT contract please follow the steps outlined here . Let's test some of this added functionality to make sure it works as intended. Foundry offers an extremely fast EVM native testing framework through Forge. Within your test folder rename the current Contract.t.sol test file to NFT.t.sol. This file will contain all tests regarding the NFT's mintTo method. Next, replace the existing boilerplate code with the below: // SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.10; import "forge-std/Test.sol";
import "../src/NFT.sol"; contract NFTTest is Test { using stdStorage for StdStorage; NFT private nft; function setUp() public { // Deploy NFT contract nft = new NFT("NFT_tutorial", "TUT", "baseUri"); } function testFailNoMintPricePaid() public { nft.mintTo(address(1)); } function testMintPricePaid() public { nft.mintTo{value: 0.08 ether}(address(1)); } function testFailMaxSupplyReached() public { uint256 slot = stdstore .target(address(nft)) .sig("currentTokenId()") .find(); bytes32 loc = bytes32(slot); bytes32 mockedCurrentTokenId = bytes32(abi.encode(10000)); vm.store(address(nft), loc, mockedCurrentTokenId); nft.mintTo{value: 0.08 ether}(address(1)); } function testFailMintToZeroAddress() public { nft.mintTo{value: 0.08 ether}(address(0)); } function testNewMintOwnerRegistered() public { nft.mintTo{value: 0.08 ether}(address(1)); uint256 slotOfNewOwner = stdstore .target(address(nft)) .sig(nft.ownerOf.selector) .with_key(1) .find(); uint160 ownerOfTokenIdOne = uint160( uint256( (vm.load(address(nft), bytes32(abi.encode(slotOfNewOwner)))) ) ); assertEq(address(ownerOfTokenIdOne), address(1)); } function testBalanceIncremented() public { nft.mintTo{value: 0.08 ether}(address(1)); uint256 slotBalance = stdstore .target(address(nft)) .sig(nft.balanceOf.selector) .with_key(address(1)) .find(); uint256 balanceFirstMint = uint256( vm.load(address(nft), bytes32(slotBalance)) ); assertEq(balanceFirstMint, 1); nft.mintTo{value: 0.08 ether}(address(1)); uint256 balanceSecondMint = uint256( vm.load(address(nft), bytes32(slotBalance)) ); assertEq(balanceSecondMint, 2); } function testSafeContractReceiver() public { Receiver receiver = new Receiver(); nft.mintTo{value: 0.08 ether}(address(receiver)); uint256 slotBalance = stdstore .target(address(nft)) .sig(nft.balanceOf.selector) .with_key(address(receiver)) .find(); uint256 balance = uint256(vm.load(address(nft), bytes32(slotBalance))); assertEq(balance, 1); } function testFailUnSafeContractReceiver() public { vm.etch(address(1), bytes("mock code")); nft.mintTo{value: 0.08 ether}(address(1)); } function testWithdrawalWorksAsOwner() public { // Mint an NFT, sending eth to the contract Receiver receiver = new Receiver(); address payable payee = payable(address(0x1337)); uint256 priorPayeeBalance = payee.balance; nft.mintTo{value: nft.MINT_PRICE()}(address(receiver)); // Check that the balance of the contract is correct assertEq(address(nft).balance, nft.MINT_PRICE()); uint256 nftBalance = address(nft).balance; // Withdraw the balance and assert it was transferred nft.withdrawPayments(payee); assertEq(payee.balance, priorPayeeBalance + nftBalance); } function testWithdrawalFailsAsNotOwner() public { // Mint an NFT, sending eth to the contract Receiver receiver = new Receiver(); nft.mintTo{value: nft.MINT_PRICE()}(address(receiver)); // Check that the balance of the contract is correct assertEq(address(nft).balance, nft.MINT_PRICE()); // Confirm that a non-owner cannot withdraw vm.expectRevert("Ownable: caller is not the owner"); vm.startPrank(address(0xd3ad)); nft.withdrawPayments(payable(address(0xd3ad))); vm.stopPrank(); }
} contract Receiver is ERC721TokenReceiver { function onERC721Received( address operator, address from, uint256 id, bytes calldata data ) external override returns (bytes4) { return this.onERC721Received.selector; }
} The test suite is set up as a contract with a setUp method which runs before every individual test. As you can see, Forge offers a number of cheatcodes to manipulate state to accommodate your testing scenario. For example, our testFailMaxSupplyReached test checks that an attempt to mint fails when the max supply of NFT is reached. Thus, the currentTokenId of the NFT contract needs to be set to the max supply by using the store cheatcode which allows you to write data to your contracts storage slots. The storage slots you wish to write to can easily be found using the forge-std helper library. You can run the test with the following command: forge test If you want to put your Forge skills to practice, write tests for the remaining methods of our NFT contract. Feel free to PR them to nft-tutorial , where you will find the full implementation of this tutorial.

