This does not check the emitting address. event Transfer(address indexed from, address indexed to, uint256 amount); function testERC20EmitsTransfer() public { // Only `from` and `to` are indexed in ERC20's `Transfer` event, // so we specifically check topics 1 and 2 (topic 0 is always checked by default), // as well as the data (`amount`). vm.expectEmit(true, true, false, true); // We emit the event we expect to see. emit MyToken.Transfer(address(this), address(1), 10); // We perform the call. myToken.transfer(address(1), 10);
} This does check the emitting address. event Transfer(address indexed from, address indexed to, uint256 amount); function testERC20EmitsTransfer() public { // We check that the token is the event emitter by passing the address as the fifth argument. vm.expectEmit(true, true, false, true, address(myToken)); emit MyToken.Transfer(address(this), address(1), 10); // We perform the call. myToken.transfer(address(1), 10);
} We can also assert that multiple events are emitted in a single call. function testERC20EmitsBatchTransfer() public { // We declare multiple expected transfer events for (uint256 i = 0; i < users.length; i++) { vm.expectEmit(true, true, true, true); emit Transfer(address(this), users[i], 10); } // We also expect a custom `BatchTransfer(uint256 numberOfTransfers)` event. vm.expectEmit(false, false, false, false); emit BatchTransfer(users.length); // We perform the call. myToken.batchTransfer(users, 10);
}

